import React from "react";
import { Card } from "@mui/material";
export default function index() {
  return (
    <div>
      <Card variant="outlined" sx={{ height: 120, width: 150 }}></Card>
      <Card variant="outlined" sx={{ height: 150, width: 150 }}></Card>
      <Card variant="outlined" sx={{ height: 150, width: 150 }}></Card>
      <Card variant="outlined" sx={{ height: 150, width: 150 }}></Card>
      <Card variant="outlined" sx={{ height: 150, width: 150 }}></Card>
      <Card variant="outlined" sx={{ height: 150, width: 150 }}></Card>
      <Card variant="outlined" sx={{ height: 150, width: 150 }}></Card>
    </div>
  );
}
